import rentCar from "../ImageIcons/Welcome/commercial-car.png";
import useCar from "../ImageIcons/Welcome/car.png";
import Card from "react-bootstrap/Card";
import { Container, Row } from "react-bootstrap";
function Welcome() {
  return (
    <Container>
      <Row
        style={{
          display: "flex",
          justifyContent: "space-evenly",
          marginTop: "5%",
        }}
      >
        <Card style={{ width: "30%", height: "15rem" }}>
          <Card.Img variant="top" src={rentCar} />
          <Card.Body>
            <Card.Title>Become a Host</Card.Title>
          </Card.Body>
        </Card>
        <Card style={{ width: "12rem" }}>
          <Card.Img variant="top" src={useCar} />
          <Card.Body>
            <Card.Title>Card Title</Card.Title>
            <Card.Text>
              Some quick example text to build on the card title and make up the
              bulk of the card's content.
            </Card.Text>
          </Card.Body>
        </Card>
      </Row>
    </Container>
  );
}
export default Welcome;
